B.Ym=new A.hs("When designing, designers have to keep in mind the reality of their work. Is it feasible in the real world? The constants I am applying exist in the real world? And this applies to every aspect of design, whether it is a poster, a magazine, a font, an interface etc. As a graphic designer prints a poster multiple times before the final version, a UI/UX designer needs to check that the users can actually use the interface both from a design perspective and a usability check.\n\nBut for some special projects, I take it a bit further. As a hobbyist developer, I choose to develop my own designs and ideas to actual products, like this website, designed and created from scratch.",null,B.aw,B.kU)
